import React from "react";
import { Link } from "react-router-dom";
import './user.scss';
import axios from "axios";

export default function Register() {
    return (
        <div>
            <h1>Регистрация</h1>
            <p>Уже есть аккаунт? <Link to="/registration">Войти</Link></p>
        </div>
    )
}
